import React from 'react'
import { Row } from 'react-bootstrap';

function Home(props) {
    return (
        <div>
            <Row>
            <h1 class=""> Portfolio de Samuel </h1>
            <p class="center-text-description">
                Hello ! Je m'appelle Samuel. Je suis un étudiant à Epitech.
            </p>
            </Row>
        </div>
    )
}

export default Home;
